import React, { useEffect } from "react";
import "../style/project.css";
import ReactPlayer from "react-player";
import "aos/dist/aos.css";
import Aos from "aos";

const Project = (props) => {
  useEffect(() => {
    Aos.init({ duration: 2000 });
  }, []);
  return (
    <section data-aos="fade-up" className="section" id="project">
      <div className="project-container">
        <div className="project-content">
          <h2>{props.props.title}</h2>
          <p>{props.props.tag}</p>
          <ReactPlayer url="https://vimeo.com/526182623" />
        </div>
        <div className="project-info">
          <h3 className="h3">{props.props.title}</h3>
          <span className="text-muted">{props.props.type}</span>
          <p>{props.props.description}</p>
          <ul className="list-unstyled list-line mb-5">
            <li>Data Visualization</li>
            <li>HTML/CSS</li>
            <li>Javascript</li>
            <li>D3.js</li>
          </ul>
        </div>
      </div>
    </section>
  );
};

export default Project;
